import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from '../pages/Home'


export default function Main(){
    return (
        <Routes>
            <Route exact path='/' element={Home}></Route>
            <Route exact path='/upperwear' element={Home}></Route>
            <Route exact path='/lowerwear' element={Home}></Route>
            <Route exact path='/hats' element={Home}></Route>
            <Route exact path='/footwear' element={Home}></Route>
            <Route exact path='/login' element={Home}></Route>
            <Route exact path='/create-account' element={Home}></Route>
        </Routes>
    )
}
